import React, { Component } from 'react';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import { Carousel } from 'react-responsive-carousel';

export class DemoCarousel extends Component {
  render() {
    return (
      <div>
        <Carousel>
          <div>
            <img src={require('../../img/4.jpg')} alt='img1' />
            <p className='legend'>Legend 1</p>
          </div>
          <div>
            <img src={require('../../img/12.jpg')} alt='img2' />
            <p className='legend'>Legend 2</p>
          </div>
          <div>
            <img src={require('../../img/17.jpg')} alt='img3' />
            <p className='legend'>Legend 3</p>
          </div>
          <div>
            <img src={require('../../img/13.jpg')} alt='img3' />
            <p className='legend'>Legend 3</p>
          </div>
          <div>
            <img src={require('../../img/14.jpg')} alt='img3' />
            <p className='legend'>Legend 3</p>
          </div>
        </Carousel>
      </div>
    );
  }
}

export default DemoCarousel;
